// Function to spawn butterflies
// Increase delayInSpawn to increase the time at which butterflies appear. (directly proportinal)
// delayInSpawn is **NOT** equal to time after which butterflies appear.
function spawnButterfly(delayInSpawn) {
  var r = Math.random,
    n = 0,
    d = document,
    w = window,
    i = d.createElement("img"),
    z = d.createElement("div"),
    zs = z.style,
    a = w.innerWidth * r(),
    b = w.innerHeight * r();
  zs.position = "fixed";
  zs.left = 0;
  zs.top = 0;
  zs.opacity = 0;
  z.appendChild(i);
  i.src = butterflyImgData[Math.floor(Math.random() * butterflyImgData.length)];
  d.body.appendChild(z);
  function R(o, m) {
    return Math.max(Math.min(o + (r() - 0.5) * delayInSpawn, m - 50), 50);
  }
  function A() {
    var x = R(a, w.innerWidth),
      y = R(b, w.innerHeight),
      d = 5 * Math.sqrt((a - x) * (a - x) + (b - y) * (b - y));
    zs.opacity = n;
    n = 1;
    zs.transition = zs.webkitTransition = d / 1e3 + "s linear";
    zs.transform = zs.webkitTransform = "translate(" + x + "px," + y + "px)";
    i.style.transform = i.style.webkitTransform = a > x ? "" : "scaleX(-1)";
    a = x;
    b = y;
    setTimeout(A, d);
  }
  setTimeout(A, r() * 3e3);
}

// Call spawnButterfly() n times to spawn n butterflies
spawnButterfly(400);
spawnButterfly(4000);
spawnButterfly(10000);
